"<hr />\n"
"<p align=\"center\" style=\" margin-top:14px; margin-bottom:12px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-size:large; font-weight:600; color:#007bff;\"> Introducing Nemo AI</span></p>\n"
"<p style=\" margin-top:12px; margin-bottom:12px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-size:16px; font-weight:600;\">Nemo</span><span style=\" font-size:16px;\"> is an advanced </span><span style=\" font-size:16px; font-weight:600;\">Gemini-powered AI assistant</span><span style=\" font-size:16px;\">, designed for real-time, voice-controlled virtual assistance. It integrates </span><span style=\" font-size:16px; font-weight:600; color:#9400d3;\">Gemini Flash API</span><span style=\" font-size:16px;\"> and aims for a future </span><span style=\" font-size:16px; font-weight:600; color:#ff0000;\">fully offline</span><span style=\" font-size:16px;\"> experience for privacy. </span></p>\n"
